// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Header from './components/header';
import Signup from './components/Signup';
import './App.css';

function Home() {
  return (
    <div>
      <div className="bottom2">
        <Link to="/signup">SignUp</Link>
        <Link to="/login">Login</Link>
      </div>

      <p className="name">
        <span>
          <img id="ll" src="https://cdn.glitch.global/74966f89-6b4a-4631-ad79-95f11a65e0dd/logo7.jpg?v=1697534616110" alt="Helping Hands Logo"/>
        </span>
        <span className="name1">Explore</span>
        <span className="name2">Epic</span>
        <span className="name1">...</span>
      </p>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/signup" element={<Signup />} />
          {/* Add other routes here */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
